import React from 'react';

class Detail extends React.Component{
    componentDidMount(){
        const{location, history} = this.props;
        console.log(history);
        if(location.state === undefined){
            history.push("/");
        }
    }

    render(){
        return (<div className="container jumbotron my-4">
            Hi
        </div>);
    }
}

export default Detail;
